import logo from './logo.svg';
import "./App.css";
import './animations/Rotation.css';
import './animations/Triangle3DSpin.css';

function App() {
	return (
		<div className="flex-wrap">

			<div className="demo">
				<h1>LINEAR ROTATION</h1>
				<img src={logo} className="App-logo" alt="logo" />
			</div>

			<div className="demo radial-gradient">
				<h1>TRIANGLE 3D SPIN</h1>
				<div className="wrapper">
					{[...Array(10)].map((x, i) =>
					(
						<div className={`triangle`} style={{ "--i": i }}>

						</div>
					)

					)}
				</div>
			</div>

		</div>
	);
}



export default App;
